removeStrategy:
  rbac: SYNC
  items: NONE
items:
  - orphanedItemStrategy:
      defaultOrphanedItemStrategy:
        pruneDeadBranches: true
        daysToKeep: -1
        numToKeep: 1
    SCMSources:
      - bitbucket:
          autoRegisterHook: true
          excludes: ''
          traits:
            - bitbucketBranchDiscovery:
                strategyId: 3
            - bitbucketPullRequestDiscovery:
                strategyId: 2
            - bitbucketForkDiscovery:
                trust:
                  bitbucketTrustTeam: {}
                strategyId: 1
            - bitbucketBuildStatusNotifications:
                sendSuccessNotificationForUnstableBuild: false
            - cloudBeesSCMReporting:
                visibleLinesOnly: false
                handlers:
                  - endBuildError:
                      maxLogLines: 100
                  - stage:
                      verbosity:
                        all: {}
                  - junit: {}
                  - warningsNG: {}
            - cleanBeforeCheckoutTrait:
                extension:
                  cleanBeforeCheckout:
                    deleteUntrackedNestedRepositories: true
          repoOwner: acaternberg
          serverUrl: https://bitbucket.org
          includes: '*'
          checkoutCredentialsId: SAME
          credentialsId: bitbucket
          id: com.cloudbees.jenkins.plugins.bitbucket.BitbucketSCMNavigator::https://bitbucket.org::acaternberg::app_go1
          repository: app_go1
    healthMetrics:
      - worstChildHealthMetric:
          recursive: true
      - averageChildHealthMetric: {}
      - jobStatusHealthMetric:
          unstable: true
          countVirginJobs: false
          failure: true
          success: true
          unbuilt: true
      - projectEnabledHealthMetric: {}
    kind: organizationFolder
    displayName: Andreas Caternberg
    name: go-team-project
    navigators:
      - bitbucket:
          traits:
            - bitbucketBranchDiscovery:
                strategyId: 3
            - bitbucketPullRequestDiscovery:
                strategyId: 2
            - bitbucketForkDiscovery:
                trust:
                  bitbucketTrustTeam: {}
                strategyId: 1
            - bitbucketBuildStatusNotifications:
                sendSuccessNotificationForUnstableBuild: false
            - cloudBeesSCMReporting:
                visibleLinesOnly: false
                handlers:
                  - endBuildError:
                      maxLogLines: 100
                  - stage:
                      verbosity:
                        all: {}
                  - junit: {}
                  - warningsNG: {}
            - cleanBeforeCheckoutTrait:
                extension:
                  cleanBeforeCheckout:
                    deleteUntrackedNestedRepositories: true
          repoOwner: acaternberg
          serverUrl: https://bitbucket.org
          credentialsId: bitbucket
    projectFactories:
      - customMultiBranchProjectFactory:
          factory:
            customBranchProjectFactory:
              marker: build-go-bin.sh
              definition:
                cpsScmFlowDefinition:
                  scriptPath: resources/pipelines/Jenkinsfile.go.groovy
                  scm:
                    gitSCM:
                      userRemoteConfigs:
                        - userRemoteConfig:
                            credentialsId: bitbucketssh
                            url: git@bitbucket.org:acaternberg/shared_libs.git
                      branches:
                        - branchSpec:
                            name: '*/main'
                  lightweight: false
    trigger:
      periodicFolderTrigger:
        interval: 1h
    strategy:
      allBranchesSame:
        props:
          - buildRetention:
              buildDiscarder:
                logRotator:
                  artifactDaysToKeep: -1
                  artifactNumToKeep: -1
                  daysToKeep: -1
                  numToKeep: 4
    properties:
      - jiraFolderProperty:
          sites:
            - jiraSite:
                threadExecutorNumber: 10
                appendChangeTimestamp: false
                recordScmChanges: true
                supportsWikiStyleComment: false
                updateJiraIssueForAllStatus: true
                useHTTPAuth: false
                readTimeout: 30
                disableChangelogAnnotations: false
                credentialsId: atlassiantoken
                timeout: 10
      - organizationChildHealthMetricsProperty:
          templates:
            - worstChildHealthMetric:
                recursive: true
            - averageChildHealthMetric: {}
            - jobStatusHealthMetric:
                unstable: true
                countVirginJobs: false
                failure: true
                success: true
                unbuilt: true
            - projectEnabledHealthMetric: {}
      - organizationChildOrphanedItemsProperty:
          strategy:
            inherit: {}
      - organizationChildTriggersProperty:
          templates:
            - periodicFolderTrigger:
                interval: 1d
      - folderCredentialsProperty:
          credentials:
